import React,{useState} from "react";

const Restaurants=(props)=>{
    console.log('called')
    const [restaurants,setRestaurants]=useState({})
    const add=(place)=>{
        setRestaurants(restaurants[place.name](place))
    }
    const remove=(place)=>{
        setRestaurants(delete restaurants[place.name])
    }
    if(!props.restaurants.length){
        return
    }
    const filtered=props.restaurants.filter((place)=>{
        return place.photo&&place.name&&place.cuisine[0]
    })
    console.log(filtered)
    const display=filtered.map((place)=>{
        return(
            <div style={{width:400}}className="card">
                <div className="card-content">
                    <h1>{place.name}</h1>
                </div>
                <div className="content align">
                    <div className="card-image">
                        <img src={place.photo.images.thumbnail.url}></img>
                    </div>
                    <div className="align">
                        <div>
                            <p>Rating:{Math.floor(parseFloat(place.rating)*10)/10}</p>
                            <p>Cuisine:{place.cuisine[0].name}</p>
                            <p>Price:{place.price_level}</p>
                        </div>
                        <div>
                            {place.district?<p>Neighborhood:{place.neighborhood_info.name}</p>:<p></p>}
                            <a href={place.web_url} target="new"><i class="fa-solid fa-globe"></i></a>
                        </div>
                    </div>
                </div>
            </div>
        )
    })
    console.log('display',display)
    return(
        <div>
            <h1>Restaurants</h1>
            {display}
        </div>
    )
}

export default Restaurants
